A special thank you to the brave men and women who risk their lives to fight wildfires and keep our communities safe. I had the pleasure of meeting with Hemet City Fire Fighter Association President Dave Prietto and Vice President Dan Billington to discuss the countless lives, homes, and businesses our firefighters have saved.

Your dedication and sacrifice do not go unnoticed thank you for all that you do!

